    def select_file(self):
        """选择 Excel 文件"""
        options = QFileDialog.Options()
        file, _ = QFileDialog.getOpenFileName(
            self, "选择 Excel 文件", "",
            "Excel Files (*.xlsx);;All Files (*)",
            options=options
        )

        if file:
            self.file_path_input.setText(file)
            self.status_bar.setText(f"已选择文件: {file.split('/')[-1]}")
            self.serviceID_input.setEnabled(True)
            self.methodID_input.setEnabled(True)
            self.parse_button.setEnabled(True)

    def parse_excel(self):
        """解析 Excel 文件并显示结果"""
        file_path = self.file_path_input.text()
        serviceID_str = self.serviceID_input.text().strip()
        methodID_str = self.methodID_input.text().strip()

        # 清除之前的结果
        self.service_text.clear()
        self.datatype_text.clear()

        # 检查输入
        errors = []
        if not file_path:
            errors.append("请选择Excel文件")
        if not serviceID_str:
            errors.append("请输入服务ID")
        if not methodID_str:
            errors.append("请输入方法ID")

        if errors:
            self.status_bar.setText("错误: " + ", ".join(errors))
            return

        # 转换ID为整数
        try:
            # 处理十六进制输入（带或不带0x前缀）
            serviceID = int(serviceID_str, 16) if serviceID_str.startswith("0x") else int(serviceID_str, 16)
            methodID = int(methodID_str, 16) if methodID_str.startswith("0x") else int(methodID_str, 16)
        except ValueError:
            self.status_bar.setText("错误: 服务ID和方法ID必须是有效的十六进制数")
            return

        try:
            # 读取 Excel 文件
            self.status_bar.setText("正在解析Excel文件...")
            QApplication.processEvents()  # 更新UI

            df = pd.read_excel(file_path, sheet_name=None, engine='openpyxl')

            # 获取所需的 sheet 数据
            service_interfaces_df = df['ServiceInterfaces']
            datatype_definition_df = df['DataTypeDefinition']

            if service_interfaces_df is None:
                self.status_bar.setText("错误: Excel文件中缺少 'ServiceInterfaces' 工作表")
                return

            if datatype_definition_df is None:
                self.status_bar.setText("错误: Excel文件中缺少 'DataTypeDefinition' 工作表")
                return

            # 查找 ServiceInterfaces 中符合条件的行
            result_rows = service_interfaces_df[
                (service_interfaces_df.iloc[:, 1] == serviceID_str) &
                (service_interfaces_df.iloc[:, 7] == methodID_str)
                ]
            print(1)
            if result_rows.empty:

                self.status_bar.setText(f"未找到服务ID:0x{serviceID_str} 方法ID:0x{methodID_str} 的匹配项")
                return
            print(2)
            # 显示结果
            self.status_bar.setText(f"找到 {len(result_rows)} 条匹配记录")
            print(3)
            self.display_results(result_rows, datatype_definition_df)
            print(4)

        except Exception as e:
            self.status_bar.setText(f"错误: {str(e)}")
            self.service_text.setPlainText(f"发生错误:\n{str(e)}")

