            if not datatype_row.empty:
                datatype_html += '<div class="section">'
                datatype_html += f'<div class="header">数据类型: {param_data_type}</div>'

                for col_idx, col_name in enumerate(datatype_definition_df.columns):
                    cell_value = datatype_row.iloc[0, col_idx]
                    # 跳过空值
                    if pd.isna(cell_value):
                        continue

                    datatype_html += f"""
                    <div class="info-row">
                        <div class="info-label">{col_name}:</div>
                        <div class="info-value">{cell_value}</div>
                    </div>
                    """

                datatype_html += "</div>"
            else:
                datatype_html += f'<div class="section"><div class="header">数据类型未找到</div>'
